column1:
God Bless Indonesia, Alkhamdulillaah; THE NEWS THAT HAS BEEN ACCORDED TO BY ALLAAH SWT !!!, is that men are still not able to defend/help/guide women at all, so it seems as if women have been completely abandoned !!!, UNTIL "WOMAN, WOMEN, ALL WOMEN" HAVE BEEN GLORIFIED BY ALLAAH SWT, Subkhaanallaah; It's the Most Main, Subkhaanallaah.
Indeed, Allaah SWT has always offered/provided help and victory!!! So there WILL NOT BE ANYTHING NOT PERFECT/COMPLETE/GLORIOUS at all !!!. SO I WIM "MY SALARY, BONUS, REWARDS, ..., FOR ME" ALREADY NUMBER ONE NOW!!!.

Thorough too, It's MOST IMPORTANT, 
It's MOST MAIN, Alkhamdulillaah;
there is Allaah's Victory, Allaah's Justice, Allaah's Truth, Allaah's Destiny, Allaah's Blessing, already "Qodrat, Irodat, Qodho, Qodar, Takdir.", There is "Diinillaah, Kitabullaah", Amantu Billaah, Alkhamdulillaah;
I'm Wim "Wim&Family", Alkhamdulillaah;
I am Wim Jundhan Wimbadi Bin Sururi Mulyosurono Bin Mursidi, Alkhamdulillaah;
LAA ILLALA ILLALLAAH,
Subkhaanallaah, Allaahu Akbar.
